import {
    HideLoadedUsers, SetPageCount,
    SetPageSize,
    SetUsers,
    ToggleIsFetching
} from "./ActionCreators";
import axios from "axios";
import {useSelector} from "react-redux";


export const setUsers = (URL) => {
    let { auth_token } = useSelector(state => state.auth)
    return axios.get(URL, {headers: {'Authorization': `Token ${auth_token}`}})
        .then(
            response => response,
            error => console.log(`FAIL ${error}`)
        )

}
